description:
Verenigde Staten
Komedie
99 minuten

een goeie film

met Tina Fey, Amy Poehler en Sigourney Weaver

Kate (Tina Fey) is een succesvolle zakenvrouw met een druk leven. Als ze op zekere dag besluit dat het tijd is voor een kind, 
komt ze tot de ontdekking dat ze maar heel weinig kans heeft om zelf zwanger te worden. Ze gaat op zoek naar een draagmoeder en 
komt uit bij ene Angie (Amy Phoeler). Het blijkt echter nog niet zo eenvoudig om Angie voor te bereiden op haar moederschap.
